import React from 'react'
import { IconButton } from '@material-ui/core'
import { MoreHoriz } from '@material-ui/icons'

export function MenuLang() {
  return (
    <div>
      <IconButton
        size='small'
        className='btnMore'
        sx={{
          backgroundColor: '#cdcdcd',
          width: 30,
          height: 30,
          mt: 6,
        }}
      >
        <MoreHoriz sx={{ fontSize: 15 }} />
      </IconButton>
    </div>
  )
}
